$_MODULE['<{performancepro}prestashop>dashboardform_b816eba2d26e0b6240a9549abb8d9833'] = 'Nije preporučljivo da se čisti keš redovno. Keš treba očistiti samo ako postoji dobar razlog za to inlače svakih 6 meseci bi bilo optimalno. Razlog je što keš čini vaše stranice brzim. Svaki put kada očistite keš treba ponovo da se napravi, što oduzima vreme. Ako imate servis koji koji automatski sinhronizuje proizvode preko nekog API-a, možda bi trebalo da razmišljate da integrišete neke od tih strana u vaš \"pipeline\".';
$_MODULE['<{performancepro}prestashop>dashboardform_8072096e0d68b9949581113c2d0286dd'] = 'Za one funkcije koje nemaju veze sa čišćenjem keša, možda bi trebalo da razmišljate o postavljanju \"cronjob\" Interval zavisi od mnogo faktora, ali svakih 14-30 dana je uglavnom optimalan interval.';
$_MODULE['<{performancepro}prestashop>dashboardform_d0b36894112d39b7396cb88cf31e54a8'] = 'Ovi  alati će napraviti promene u vašem sistemu koje ne mogu biti vraćene. Zato se preporučuje da bekapujete bazu podatak i ceo sistem iz sigurnosnih razloga. Da bi izbegli problem prilikom čišćenja pametnog keša i SF keša, sačekajte da se čišćenje završi pre nego počnete bilo šta da radite na vašoj aplikaciji.';
$_MODULE['<{performancepro}prestashop>dashboardform_112fd31c936f6803c00f50e388c5103c'] = 'Neke komande će potrajati pa se stoga preporučuje da ih izvršavate jednu po jednu. Naročito je zagrevač keša vremenski zahtevan.';
